import CenterMain from "./CenterMain";
import CenterSubject from "./CenterSubject";
import { Container, Row, Col } from "react-bootstrap";

export default function Center() {
  return (
    <div>
      <Container fluid>
        <Row>
          <Col xs={3}  className="bg-info">
            <CenterSubject />
          </Col>
          <Col xs="9" className="bg-dark text-light" >
            <CenterMain />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
